	('32','4015','3','Коврик для мыши с USB-разветвителем на 3 порта',NULL,'пластик','21х4,6х2,3 см, коврик 20х20',NULL,NULL,NULL,NULL,'<p class="MsoNormal">Удобно организованное рабочее пространство – один из залогов\r\nплодотворной работы. Хорошо, когда не требуется совершать множество\r\nманипуляций, чтобы что-то найти, достать, включить. Все самое необходимое\r\nдолжно располагаться, что называется, под рукой. </p>\r\n\r\n<p class="MsoNormal">Именно под рукой окажутся два нужных устройства, если на\r\nстоле будет стоять этот <span lang="EN-US" style="">USB</span>-разветвитель. Коврик для мыши компактно свернут в корпусе\r\nразветвителя. При необходимости коврик можно вытащить за «ушко», а когда\r\nон долго не используется или мешает – убрать его, просто нажав на кнопку<br /> </p>','3 порта USB 2.0<br />','423','23763','2008-08-27 14:15:05'),
