	('39','3963','3','Часы',NULL,'металл, пластик','10,9х10,9х11',NULL,NULL,NULL,NULL,'Необычный дизайн объединил классический циферблат со стрелками и\r\nэлектронные часы. По желанию владельца часы могут отображать время в\r\nразных часовых поясах. Для этого достаточно лишь выставить на каждом\r\nциферблате нужное время.<br />Поле для нанесения логотипа так органично вписано в дизайн, словно нанесение было произведено непосредственно в момент изготовления часов на фабрике<br />','Часы-будильник','828','23908','2008-08-27 14:15:05'),
