	('41','3913','3','Цифровая фоторамка «Сфера»',NULL,'пластик','D=9,5 см; H=10,3',NULL,NULL,NULL,NULL,'','Дисплей 1,5 дюйма, выпуклая линза увеличивает видимое изображение до 2,2 дюйма. <br />Возможность хранить до 52 фотографий и 10 голосовых записей.<br />Часы, будильник, календарь, термометр.<br />Питание от аккумулятора. Загрузка фотографий и зарядка через порт USB 2.0<br /><br />','2354','23742','2008-08-27 14:15:05'),
