	('43','4092','3','Устройство для передачи данных между USB-флэш-картами',NULL,'пластик','7,5х5,5х1,4',NULL,NULL,NULL,NULL,'Теперь вам не нужен компьютер, чтобы переместить данные с одной флэш-карты на другую. Обменивайтесь данными на работе, на отдыхе или в деловой поездке','Возможность выбора перемещаемых файлов: все файлы или отфильтрованные по расширению (MP3, jpg, doc или mpg)','1315','23771','2008-08-27 14:15:05'),
	('44','4073','3','Папка AUVERGNE',NULL,'искусственная кожа','26x34',NULL,NULL,NULL,NULL,'','В комплекте блокнот 20 листов','1477','23816','2008-08-27 14:15:05'),
