	('46','4114','3','Набор Easy Touch',NULL,'картон','20,0х17,5х8,0',NULL,NULL,NULL,NULL,'<p> </p> \r\n<p class="MsoNormal">Представляем вам первые наборы, для которых наше Ателье разработало подарочную упаковку!\r\n</p>\r\n<p>&nbsp;\r\n</p> \r\n<p>&nbsp; \r\n</p> <span style="-moz-background-clip: -moz-initial; -moz-background-origin: -moz-initial; -moz-background-inline-policy: -moz-initial; background-attachment: scroll;"></span> \r\n<p> В набор входит брелок c LED-фонариком, массажер и вентилятор. \r\n</p> \r\n<p>&nbsp; \r\n</p> \r\n<p>Характерная черта набора Easy Touch - обтекаемые, почти космические формы и минимализм в высшей степени: у всех этих устройств нет ни одной кнопки! Они начинают работать, стоит лишь слегка прикоснуться к ним. &nbsp; \r\n</p> \r\n<p><span style="font-size: 10pt; font-family: Arial;"></span> \r\n  <br /> \r\n</p>','  \r\n \r\n\r\nНабор упакован в подарочную упаковку, в ее основании использован переплетный картон толщиной 1,25 мм, переплетным материалом выступает бумага <span lang="EN-US">Efalin</span>, коробка имеет жесткий ложемент, плотно фиксирующий предметы из набора.\r\n <span style="-moz-background-clip: -moz-initial; -moz-background-origin: -moz-initial; -moz-background-inline-policy: -moz-initial; background-attachment: scroll;"></span>\r\n\r\n  <br /><span style="-moz-background-clip: -moz-initial; -moz-background-origin: -moz-initial; -moz-background-inline-policy: -moz-initial; background-attachment: scroll;"><span style="background: yellow none repeat scroll 0% 50%; font-size: 10pt; font-family: Arial; -moz-background-clip: -moz-initial; -moz-background-origin: -moz-initial; -moz-background-inline-policy: -moz-initial;"></span></span> \r\n  \r\n<span style="background: yellow none repeat scroll 0% 50%; -moz-background-clip: -moz-initial; -moz-background-origin: -moz-initial; -moz-background-inline-policy: -moz-initial; font-size: 10pt; font-family: Arial;"></span> \r\n','737','24052','2008-08-27 14:15:05'),
