	('52','3974','3','Дорожная сумка для документов',NULL,'нейлон','13,5х6х16',NULL,NULL,NULL,NULL,'Сумка изготовлена из нейлона рипстоп 600 D. Рипстоп – особенный\r\nинновационный материал. В общую структуру ткани на равном расстоянии\r\nдруг от друга вплетены более толстые волокна, что придает материалу\r\nбольшую прочность без ощутимого увеличения веса. Рипстоп идеально\r\nподходит для применения в области спорта и туризма. Он устойчив к\r\nвыцветанию, неприхотлив в уходе, создает прекрасную защиту от дождя и\r\nветра, хорошо «дышит»<span class="blockt"></span><span class="blockt"></span>','','631','23841','2008-08-27 14:15:05'),
	('53','4094.30','3','Зонт "Антишторм", черный',NULL,'полиэстер, пластик','93х90х78',NULL,NULL,NULL,NULL,'Благодаря уникальному дизайну зонт всегда занимает оптимальное положение относительно ветра. Зонт прошел испытания в аэродинамической трубе и не выгибается даже при порывах ветра в 100 км/ч',' Номинирован на премию журнала Time «Лучшее изобретение 2007 года»\r\n  <br />«Reddot design award» Победитель 2007 года\r\n  <br />Победитель голландской премии в области дизайна 2007 года\r\n  <br />Первый приз премии «Audi design»\r\n\r\nПоставляется в чехле&nbsp;\r\n','1658','23951','2008-08-27 14:15:05'),
	('54','3988','3','Устройство для дистанционного обнаружения ключей',NULL,'предметы – пластик, коробка - металл','коробка :11,3х15,2х1,7 см, брелок: 6,5х3,4х1,2 см, карта: 8,3х5,5х0,3',NULL,NULL,NULL,NULL,'Каждый человек тратит год своей жизни на поиск пропавших вещей... <br />Теперь поиск ключей не займет много времени. Карточку с «волшебной кнопкой» положите в бумажник, и, если ключи потеряются, просто нажмите на кнопку. Брелок с ключами немедленно откликнется на ваш зов<br />','Брелок издает высокие, хорошо слышимые звуки. Дистанция обнаружения – до 50 м','698','23888','2008-08-27 14:15:05'),
