	('58','4000.10','3','Шарф, серый',NULL,'70% пашмина, 30% шелк','175х65',NULL,NULL,NULL,NULL,'Пашмина – пух (подшерсток) горной козы, выщипанный или вычесанный вручную с живота и шеи животного, где он особенно мягкий и пушистый. Пашмина – ткань более высокого качества, чем кашемир. Толщина «нити» пашмины не превышает 14 микрон\r\n<br />',' Шарфы упакованы в прозрачный полиэтиленовый пакет. \r\n \r\n \r\n  <br />В течение 15&nbsp; дней могут быть изготовлены стандартные подарочные коробки. \r\n  <br /> Минимальный тираж 100 шт. \r\n  <br /> Дополнительно: печать логотипа на коробке методом шелкографии, расчет по прайс-листу. \r\n  <br /> Габариты коробки: 170х210х30 мм, цвет картона бежевый \r\n','629','23917','2008-08-27 14:15:05'),
