	('64','4019','3','Набор для барбекю',NULL,'дерево, металл, искусственная кожа','37,5х25х7,7',NULL,NULL,NULL,NULL,'Рукоятки инструмента изготовлены из бука.<br />Древесина бука белая с желтовато-красным оттенком и с красивым\r\nрисунком. <br />Будучи твердой и плотной, она легко обрабатывается. Благодаря своей прочности и декоративности буковая\r\nдревесина используется для изготовления паркета, мебели, корпусов радиоприемников и телевизоров, а также музыкальных инструментов<br />','В набор входят:<br />1.вилка;<br />2.лопатка;<br />3.щипцы.<br /><br /><br />','2306','23840','2008-08-27 14:15:05'),
