	('121','3991','3','Винный альбом',NULL,'ламинированный картон','17x16,5x5',NULL,NULL,NULL,NULL,'Винный альбом создан для хранения этикеток любимых напитков: вин, ликеров, виски и коньяков. Сохраните для себя незабываемые ощущения и особенные моменты, пережитые в компании родных и друзей…<br /><br />При помощи специально разработанной пленки, поставляемой совместно с альбомом, можно легко снять этикетку с любой бутылки, и, поместив ее на страницу альбома, в нескольких словах описать, чем она вам памятна. <br /><br />Вы больше никогда не забудете сорт или марку вина, доставившего вам истинное наслаждение – и с вами навсегда останутся те удивительные моменты, когда вы пробовали это вино!<br /><br />','','998','23850','2008-08-27 14:15:06'),
	('122','3941','3','Кружка-мешалка',NULL,'металл, пластик','D=8,5 см; H=11,2',NULL,NULL,NULL,NULL,'Эта кружка избавит вас от необходимости перемешивать чай с\r\nсахаром, кофе с молоком и т. д. А точнее, она это сделает сама! Надо лишь нажать\r\nна кнопку – и миниатюрный пропеллер, встроенный в дно кружки, перемешает содержимое. <br />Приятный бонус: таким же образом кружку можно помыть. Капля моющего\r\nсредства, немного воды, кнопка – и кружка чиста!','Емкость 400 мл','392','23887','2008-08-27 14:15:06'),
