	('135','3971','3','Набор игр',NULL,'футляр – ЭВА','47х24х15,5',NULL,NULL,NULL,NULL,'Девиз этого набора – функциональность и стиль. В удобном элегантном кейсе собраны самые популярные игры, которые помогут скрасить минуты ожидания или приятно провести время в хорошей компании','В набор входят: нарды, шахматы, домино, 2 колоды карт, 10 игральных костей, 2 стакана для игры в кости, поле для игры в покер 40х60 см, поле для игры в шахматы и нарды 30х30 см и 200 фишек для игры в покер<br /><br />ЭВА или этиленвинилацетат – легкий, упругий, износоустойчивый материал, \r\nобладающий амортизирующими свойствами. Футляр, выполненный из ЭВА, \r\nзащитит набор от любых случайностей<br />','4633','23873','2008-08-27 14:15:06'),
