	('137','3973','3','Дорожная сумка для документов',NULL,'нейлон','27,5х9х19',NULL,NULL,NULL,NULL,'Сумка изготовлена из нейлона рипстоп 600 D. Рипстоп – особенный инновационный материал. В общую структуру ткани на равном расстоянии друг от друга вплетены \r\nболее толстые волокна, что придает материалу большую прочность без \r\nощутимого увеличения веса. Рипстоп идеально подходит для \r\nприменения в области спорта и туризма. Он устойчив к выцветанию, \r\nнеприхотлив в уходе, создает прекрасную защиту от дождя и ветра, хорошо «дышит»<br /><span class="blockt"><br /></span>','<span class="blockt"><br /></span><br />','780','23820','2008-08-27 14:15:06'),
