	('189','4074.50','3','Эргономичная авторучка PenAgain, красная',NULL,'пластик','12х5х2',NULL,NULL,NULL,NULL,'<p>Идея изобретения PenAgain возникла у американского школьника Колина Роше в 1987 году, когда он однажды купил гибкую авторучку и выгнул ее так, чтобы ему было удобнее писать. \r\n</p> \r\n<p> \r\n  <br /> Тогда же был изготовлен из подручных материалов и первый прототип. Спустя более 10 лет Колин со своим партнером Бобби Ронсом запустили свое изобретение в производство, и сегодня авторучка PenAgain завоевывает все большую популярность в мире. \r\n</p> \r\n<p> \r\n  <br /> В 2007 году PenAgain стала лауреатом премии «Продукт года» по версии журнала RETAILING TODAY. \r\n</p> \r\n<p> \r\n  <br /> До сих пор при выпуске новых авторучек производители думали лишь о затратах и о технологичности. Создатели PenAgain прежде всего думали о комфорте. \r\n</p> \r\n<p> \r\n  <br /> Попробуйте сделать несколько записей авторучкой PenAgain, и вы сразу почувствуете, насколько она отличается от обычных авторучек. С каждым движением ваша рука&nbsp; пытается избавиться от многолетней привычки к неправильному письму. \r\n</p> \r\n<p> \r\n  <br /> Дизайн PenAgain разработан с учетом анатомического строения руки. Хотя поначалу PenAgain может вызвать странные ощущения, постарайтесь не сжимать корпус авторучки. Напротив, позвольте руке расслабиться, удерживайте ручку лишь весом вашей кисти. И вы почувствуете, как исчезает напряжение от письма. \r\n</p> \r\n<p> \r\n  <br /> Авторучка PenAgain – простой, полезный и в то же время совершенно необыкновенный подарок, который вы можете сделать себе, своим близким, коллегам или партнерам. Благодаря своим уникальным качествам, PenAgain идеально подходит для всех кто много пишет – для учащихся, офисных работников, учителей, врачей, журналистов, писателей. \r\n</p> \r\n<p> \r\n  <br /> Обратите внимание на реакцию окружающих, когда вы пишете авторучкой PenAgain – на совещании, на занятиях, в любой ситуации, где от вас требуется поставить подпись на документе. Изумленный взгляд, затем просьба посмотреть и подержать, и неизбежный вопрос: «А где можно взять такую же?». \r\n</p> \r\n<p> \r\n  <br /> И наконец – дружеский совет: не упускайте из виду вашу авторучку PenAgain! Неоднократно замечено, что оставленная без присмотра PenAgain исчезает в самый неподходящий момент... \r\n  <br /> \r\n  <br /> \r\n</p>','','53','23948','2008-08-27 14:15:07'),
