	('239','3897','3','Часы «Самолет»',NULL,'пластик','18x12x12',NULL,NULL,NULL,NULL,'Тому, кто летает во сне и наяву, для кого перелет на другой\r\nконец света – обыденность, привычно будет проснуться под звук работающего самолетного двигателя. Но проснуться не в кресле пассажира или пилота, а... дома. Красный самолетик будет\r\nмирно жужжать рядом, обдувая вас легким ветерком. А на вращающихся лопастях пропеллера, словно на облаках, высветится точное время вашего пробуждения<br />','','976','23769','2008-08-27 14:15:07'),
