	('244','3910','3','Беспроводные наушники с FM-радио',NULL,'пластик','26,5x22x10',NULL,NULL,NULL,NULL,'Музыка без ограничений! Новые беспроводные наушники позволяют свободно перемещаться и удаляться от передатчика на расстояние нескольких метров.<br />Встроенный FM-радиоприемник позволит использвать их как радио, не подключая ни к какому из устройств, а микрофон – для игр или проведения конференций через Интернет<br />','HI-FI-звук, FM-радио работает в частотах 87—107,6 MHz. Радиус действия – до 10 м. Встроенный микрофон','1177','23891','2008-08-27 14:15:08'),
	('245','3911','3','Беспроводные наушники с FM-радио',NULL,'пластик','26,5x22x10',NULL,NULL,NULL,NULL,'Музыка без ограничений! Новые беспроводные наушники позволяют свободно\r\nперемещаться и удаляться от передатчика на расстояние нескольких метров.<br />Встроенный\r\nFM-радиоприемник позволит использвать их как радио, не подключая ни к\r\nкакому из устройств, а микрофон – для игр или проведения конференций\r\nчерез Интернет','HI-FI-звук. FM-радио работает в частотах 87—107,6 MHz. Встроенный микрофон. Радиус действия до 50 м. Возможность использования одного передатчика с несколькими устройствами. Возможность использования в качестве радионяни<br /><br />','1232','23890','2008-08-27 14:15:08'),
	('246','3912','3','Беспроводные наушники с FM-радио',NULL,'пластик','26,5x22x10',NULL,NULL,NULL,NULL,'Музыка без ограничений! Новые беспроводные наушники позволяют свободно\r\nперемещаться и удаляться от передатчика на расстояние нескольких метров.<br />Встроенный\r\nFM-радиоприемник позволит использвать их как радио, не подключая ни к\r\nкакому из устройств, а микрофон – для игр или проведения конференций\r\nчерез Интернет','HI-FI-звук. FM-радио работает в частотах 87—107,6 MHz. Радиус действия – до 10 метров','620','23889','2008-08-27 14:15:08'),
