	('248','3920','3','Цифровая фоторамка «Мини»',NULL,'пластик','10,7х7,1х2',NULL,NULL,NULL,NULL,'Небольшая фоторамка на рабочем столе – давняя традиция. Один\r\nвзгляд на портрет любимого человека, семейный снимок или вид далекого лазурного\r\nберега – и настроение улучшается. Но держать на столе много рамок с фотографиями\r\nнеудобно. \r\n\r\nЦифровая фоторамка – отличное решение. Заменяет целый фотоальбом: закачайте на нее множество фотографий и перелистывайте их когда захочется','Дисплей TFT с диагональю \r\n2,4 дюйма.<br />Встроенная память 2 Mb. Возможность хранить до 54 фотографий.<br />Часы, календарь, будильник<br />','2032','23781','2008-08-27 14:15:08'),
	('249','3743','3','Подушка «Крыска»',NULL,'искусственный мех','46х49х10',NULL,NULL,NULL,NULL,'Как известно, крыса является символом будущего года по восточному календарю. Поэтому неудивителен возросший интерес к этому неизбежному спутнику жизни в больших городах. Но серый злодей, что прячется по подвалам домов, и эти милейшие существа – как говорят в Одессе, «две большие разницы». Точнее даже три: на одной зверушке-подушке можно премило подремать (а потом скатать в компактный валик и, застегнув на «липучку» спрятать до следующего раза от взглядов отчаянно завидующих друзей), другая выполнит роль деда-Мороза, водруженная на бутылку праздничного новогоднего шампанского, а третья, соответственно, станет ему подружкой Снегурочкой. Но даже когда искристое вино выпито и бенгальские свечи отгорели, рано прощаться с обаятельными крысами: одев игрушки на руки, вы сможете разыграть для детишек замечательную кукольную пьесу. А что может быть лучше для создания радостной атмосферы, чем забавный домашний спектакль?!','Нанесение на ленту размером 20х77 мм. Лента вшита в правый боковой шов подушки','333','22113','2008-08-27 14:15:08'),
