	('260','3901','3','Часы «Энергия воды»',NULL,'пластик','9,8х9,8х5',NULL,NULL,NULL,NULL,'<p class="MsoNormal">Обыкновенная вода таит в себе множество загадок, и все ее свойства до сих пор не исследованы учеными. <br /></p><p class="MsoNormal">Чтобы превратить воду в энергию, мы сковываем реки плотинами и заставляем их крутить лопатки турбин. Но оказывается, что для получения электрической энергии из воды порой достаточно буквально нескольких капель.</p><p class="MsoNormal">Представляем уникальный прибор, который можно «зарядить» водой или любой другой\r\nжидкостью (например, замерзающей при более низких температурах) </p>','При поворачивании часов вокруг своей оси происходит смена функций: часы – термометр – календарь','708','23892','2008-08-27 14:15:08'),
