	('270','3765.90','3','Светящаяся авторучка, зеленая',NULL,'пластик','12,5х2',NULL,NULL,NULL,NULL,'Действительно оригинальный сувенир! Светодиоды в корпусе загораются, если потянуть за его верхнюю часть. Подсветка настолько яркая, что позволит вам без проблем делать заметки даже в полной темноте<br />','<br />','93','22258','2008-08-27 14:15:08'),
