	('272','2948','3','«Ключ для сайта»',NULL,'пластик','5,5x4,0x0,5',NULL,NULL,NULL,NULL,'Идеальное решение для промо-кампании. Специально запрограммированный ключ вставляется в\r\nUSB-порт компьютера, после чего самостоятельно запускает \r\nинтернет-браузер и открывает ваш сайт','Программирование ключа специалистами «Проекта 111»  возможно только при одновременном заказе нанесения на этот артикул. \r\n \r\nМинимальный тираж для программирования - 50 шт. \r\n Также возможно самостоятельное программирование ключа. Инструкция\r\nк артикулу содержит программное обеспечение, текстовое описание и\r\nскриншоты.  \r\n Внимание! Для работы программы пользователь должен обладать\r\nправами администратора на компьютере, с которого производится запись ','80','22185','2008-08-27 14:15:08'),
	('273','3754','3','USB-разветвитель «Светофор»',NULL,'пластик','15х4,5х4,5',NULL,NULL,NULL,NULL,'Мы давно привыкли к тому, что на улицах движением управляет светофор: красный – стоим, желтый – готовимся, зеленый – продолжаем движение. А что если завести светофор у себя в офисе? Тогда привычный сигнал приобретет новый смысл: к примеру, красный – «осторожно, шеф не в духе»… Или зеленый – «идем на перекур, есть свободная минутка». <br /><p /><p class="MsoNormal">Если световые сигналы этого устройства можно считать развлечением, то наличие 4 USB-портов – это, согласитесь, уже заявка на серьезный функционал. Цифровой диктофон позволит делать 10-секундные голосовые заметки, а в прорези на корпусе светофора можно  разместить фотокарточку горячо любимого партнера или его визитку</p>','4 USB-порта. Подставка для визиток и диктофон, время записи – до 10 секунд\r\n<br />','442','22187','2008-08-27 14:15:08'),
	('274','3841','3','Новогодняя елка',NULL,'искусственный мех','h=15; d=13,5',NULL,NULL,NULL,NULL,'Настоящие лесные красавицы прохладны и колки, одно неловкое движение – и весь праздник вам придется считать царапины. У нашей ели нет иголок, ее разноцветные игрушки не бьются, и теребить пальцами зеленый мех – одно удовольствие. Елка-антистресс – чтобы Новый год прошел без стрессов!','','175','22232','2008-08-27 14:15:08'),
