	('280','3811','3','Сумка для покупок, с изотермическим отделением, синяя',NULL,'полиэстер','33х54х39',NULL,NULL,NULL,NULL,'При помощи специальных креплений эта сумка устанавливается на тележку в\r\nсупермаркете, а в нее складываются покупки. После оплаты покупок\r\nсумка легко снимается с тележки. <br /><br />Для «гурманов» шоппинга внутри сумки предусмотрены специальные отделения для вина и охлажденных продуктов.<br /><br />Кроме того, эта сумка идеально подходит для промо-акций – в крепления может быть вставлен логотип<br /><br />','','572','22275','2008-08-27 14:15:08'),
