	('668','2711','3','FM-трансмиттер',NULL,'пластик','10,5х5х2,9',NULL,NULL,NULL,NULL,'Представьте, что вы стали владельцем собственной радиостанции и теперь в вашем автомобиле звучат только та музыка, которая нравится именно вам. Для этого не нужно тратить миллионы долларов, достаточно приобрести FM-трансмиттер: с его помощью можно подключать к автомобильной аудиосистеме любые внешние устройства: MP3 плеер, на который скачали избранные музыкальные записи с компьютера, переносной плеер, кассетный магнитофон и даже проигрыватель виниловых дисков. И при этом – никакого вмешательства в штатную электронику: достаточно гнезда прикуривателя! Слушайте ваше персональное радио. Не дайте таким преградам, как ЛЭП или глубокий тоннель перебить вашу волну!\r\n<br />\r\n<br />Вставьте FM-трансмиттер в гнездо прикуривателя автомобиля. Соедините прилагающимся кабелем музыкальное устройство и трансмиттер. Включите режим радио на аудио системе автомобиля и трансмиттера установите одинаковую частоту (диапазон 87,5-108,5 MHz) и наслаждайтесь музыкой. Наилучшие для передачи частоты: 88.1, 88.5, 88.7, 88.9 MHz или 107.1, 107.3, 107.5, 107.7, 107.9 MHz\r\n<br />\r\n<br />','<br />','368','20329','2008-08-27 14:15:13'),
	('669','2712','3','Устройство для легкой укладки рубашек и футболок',NULL,'пластик','60х24х1',NULL,NULL,NULL,NULL,'С помощью этого устройства укладка футболок, рубашек, брюк станет легким и быстрым делом, а главное - выглядеть <br />они будут идеально! Собираетесь в командировку или в отпуск? Приходится сталкиваться с укладкой по роду деятельности? Это устройство станет для вас незаменимым помощником!<br />','','300','20429','2008-08-27 14:15:13'),
