	('677','2709','3','Электронная игра «Судоку»',NULL,'пластик','10,8х7,8х0,9',NULL,NULL,NULL,NULL,'Судоку – головоломка, изобретенная на Востоке и ставшая популярной во всем мире. Ее правила просты: игровое поле состоит из 9 квадратов по 9 клеток каждый, всего 81 клетка. Нужно расставить в клетках числа от 1 до 9 так, чтобы в каждой строке и столбце большого квадрата, а также внутри каждого из малых квадратов числа не повторялись. Часть клеток в начале игры заполнена, остальные нужно заполнить самостоятельно, используя логику и расчет.<br />Все манипуляции на игровом поле – экране touch screen –  производятся с помощью стило (входит в комплект, удобно располагается в корпусе устройства)<br />','','355','20332','2008-08-27 14:15:13'),
