	('693','2706','3','Разветвитель для автомобильного прикуривателя',NULL,'пластик','12,7х6,9х3,4',NULL,NULL,NULL,NULL,'Прикуриватель в автомобиле один, а работающих от него устройств, делающих жизнь автомобилиста более приятной и комфортной, много. Выход есть – использовать автомобильный разветвитель! Мобильный телефон, цифровую камеру и, например, ноутбук теперь можно заряжать одновременно.<br />','','184','20446','2008-08-27 14:15:13'),
	('694','2707','3','Тестер заряда батареек и аккумуляторов',NULL,'пластик','8,8х5х0,6',NULL,NULL,NULL,NULL,'Почему важно знать степень заряда батарейки? Не только для того, чтобы\r\nубедится, что прибор не подведет вас в нужную минуту, но и потому, что\r\nсмешивать в устройстве заряженные и разряженные даже частично батарейки\r\nне рекомендуется.<br />Это небольшое устройство позволяет определять степень заряда для большинства основных типов батареек: АА, ААА, С, D, N, 9V (типа &quot;Крона&quot;). Три индикатора показывают степень заряда батарейки: разряжена (poor), слабый заряд (weak), полный заряд (good).<br /><br />','','248','20338','2008-08-27 14:15:13'),
