	('698','2759','3','«Говорящий фотомяч»',NULL,'пластик','D=13',NULL,NULL,NULL,NULL,'В фотомяч можно вставить четыре фотографии (форма: круг, диаметр фотографии 6,5 см) и записать к каждой из фотографий звуковой клип продолжительностью до 15 секунд. Для воспроизведения записи нужно просто нажать на фотографию.<br />Если взять фотомяч в руки, а затем поставить его на стол, автоматически будет воспроизведена запись, сделанная для фотографии, находящейся сверху.   <br /><br />','- легкая установка фотографий<br />- крепление фоторамок к устройству при помощи встроенных  магнитов <br />\r\n- простое управление записью и воспроизведением<br />\r\n- возможность многократной перезаписи звуковых клипов<br />- громкий и чистый звук воспроизведения с\r\nтрехпозиционной регулировкой громкости (off-low-high)<br />- сделанная запись сохранится в памяти устройства (производителем заявлен срок не менее 20 лет), даже если в нем не будет батареек<br />- «замок» от случайной записи  <br />','674','20316','2008-08-27 14:15:13'),
