	('769','2653','3','Комплект для презентаций с лазерной указкой',NULL,'пластик','13,5x4,2x3,4',NULL,NULL,NULL,NULL,'<p>Это устройство позволяет проводить презентации даже в очень большой аудитории, ведь радиус его действия состовляет до 15 метров! Простота установки делает его незаменимым в неподготовленных для презентаций местах, ведь оно не требует специального програмного обеспечения для установки на оболочки Windows XP\r\n  <br />Устройство совместимо с основными программами, такими как&nbsp; Microsoft Excel или Microsoft PowerPoint.\r\n</p>\r\n<p>&nbsp;\r\n</p>\r\n<p>\r\n  <br />\r\n</p>','','1498','16594','2008-08-27 14:15:14'),
	('770','2654','3','Калькулятор',NULL,'пластик','10,2x6x1,2',NULL,NULL,NULL,NULL,'Калькулятор со сдвигающейся крышкой очень удобно носить с собой. Кнопки закрыты, и цифры на них не стираются.<br />Функцию калькулятора дополняют часы с мировым временем, календарь и будильник.<br />При нажатии большой кнопки по центру крышки она плавно сдвигается, открывая доступ к панели управления<br />','','164','16527','2008-08-27 14:15:14'),
