	('811','2989','3','Эспандер',NULL,'металл','11,4х14,5',NULL,NULL,NULL,NULL,'Хотите быть сильными, здоровыми и бодрыми? Нет ничего проще! Эспандер позволит вам заняться спортом не отвлекаясь от домашних или офисных дел. Удобно, полезно и почти незаметно для окружающих<br />','','452','22132','2008-08-27 14:15:15'),
	('812','2542.41','3','Авторучка ON-OFF, синяя с серебристым',NULL,'пластик','13,4x1,5',NULL,NULL,NULL,NULL,'Авторучка... Сотая, пятисотая, пятитысячная по счету? Возможно. Но ТАКОЙ авторучки еще не было! <br />Пишет она как все, и, как у многих прочих, корпус у нее сделан из эффектного полупрозрачного пластика. Выгодно отличает ее от остальных оригинальное решение переключателя on-off: не просто кнопка или поворотный колпачок, а полноценный рычаг, так славно щелкающий в руке – хоть для пользы дела, хоть в качестве антистресса! Просто – и необычно, что и требуется от подлинного промо-сувенира.<br />','','23.82','16618','2008-08-27 14:15:15'),
