	('819','2545','3','Шкафчик для ключей',NULL,'дерево','21,6х16,4х5,2',NULL,NULL,NULL,NULL,'Приятно открывать что-то новое в знакомых вещах. А иногда просто приятно открывать знакомые вещи – особенно когда именно для этого они и предназначены. Как, например, вот этот славный шкафчик для ключей. Отделка под красное дерево, возможность вставить любимое фото в рамку на дверце и пять крючков внутри. Что может быть проще – и что может быть лучше такой элегантной простоты? <br />','','399','16576','2008-08-27 14:15:15'),
	('820','2635.20','3','Кружка Artmark, 330 мл, оранжевая',NULL,'керамика','11x8',NULL,NULL,NULL,NULL,'Каждому человеку хотя бы раз в жизни дарили кружку, и едва ли не каждый время от времени хочет подарить ее кому-то еще. После вариантов со знаками зодиака, именем или веселой надписью руки сами тянутся к кружке ARTMARK. Она необычно выглядит и хорошо работает простой кружкой. К тому же, ее удобно держать за ручку в виде знака @.','','239','16718','2008-08-27 14:15:15'),
	('821','2635.30','3','Кружка Artmark, 330 мл, черная',NULL,'керамика','11x8',NULL,NULL,NULL,NULL,'Каждому человеку хотя бы раз в жизни дарили кружку, и едва ли не каждый время от времени хочет подарить ее кому-то еще. После вариантов со знаками зодиака, именем или веселой надписью руки сами тянутся к кружке ARTMARK. Она необычно выглядит и хорошо работает простой кружкой. К тому же, ее удобно держать за ручку в виде знака @.','','239','16719','2008-08-27 14:15:15'),
