	('833','2534','3','Брелок «ОК»',NULL,'металл','8x5x0,4',NULL,NULL,NULL,NULL,'Две соединенные ладошки издавна служат символом взаимной симпатии. А когда они еще и сложены в знак ОК – значит, у обладателя подобного символа все отлично! <br />Что ж, желаем, чтобы так оно и было, – и предлагаем вещественное воплощение символа благополучия и удачи: из одного стильного хромированного брелка можно при желании сделать два, просто разняв металлические ладошки, – и, к примеру, одну подарить другу<br />','','160','16600','2008-08-27 14:15:15'),
	('834','2538','3','Брелок «Ромб»',NULL,'металл','3,5x3,5x0,4',NULL,NULL,NULL,NULL,'','','65','16548','2008-08-27 14:15:15'),
	('835','2539','3','Штопор-открывашка',NULL,'металл','11,8x2',NULL,NULL,NULL,NULL,'Открывает любые бутылки. Очень удобен в использовании','','179','16580','2008-08-27 14:15:15'),
	('836','2607','3','Набор для пикника',NULL,'металл, нейлон','22х10',NULL,NULL,NULL,NULL,'Этот набор – настоящая находка как для тех, кто исследует последние «белые пятна» на карте нашей планеты, так и для поклонников трапез на лоне природы.<br />В нем нет ничего лишнего и все продумано до мелочей: металлический корпус бутылки, герметичная притертая пробка с резиновой прокладкой, сумка с карабином для крепления на рюкзак или одежду и тремя кармашками. В кармашках, надежно застегнутых на молнии, скрываются: фонарик с карабином на цепочке; удобный складной нож с ложкой, вилкой и открывашкой; а также оригинальный мультифункциональный предмет, совмещающий в себе свисток, лупу, компас и термометр','','385','16585','2008-08-27 14:15:15'),
	('837','2608','3','Набор для туризма и путешествий',NULL,'пластик','16х4,5',NULL,NULL,NULL,NULL,'LED-фонарик, ложка, вилка, нож - мультифункциональное устройство-трансформер, предназначенное для вылазок на природу, где оно может оказаться поистине незаменимым. Удобно ложится в руку залитый каучуком (и, соответственно, влагозащищенный) корпус фонаря, в тыльной части которого имеется смещающаяся в сторону панель, скрывающая три важнейших в походе вещи – ложку, вилку и нож со штопором и открывашкой для бутылок и банок. Все приборы металлические, поэтому фиксатором для них внутри ручки фонаря работает магнит<br /><br />','','360','16552','2008-08-27 14:15:15'),
	('838','2619','3','Набор: термос и 2 кружки',NULL,'металл','29х21,5х7,5',NULL,NULL,NULL,NULL,'','Емкость термоса 500 мл, емкость кружек по 220 мл','872','16579','2008-08-27 14:15:15'),
	('839','2631','3','Держатель для мелочей VECTOR',NULL,'пластик','25,7х11,1х14',NULL,NULL,NULL,NULL,'Офисным сотрудникам, которые не могут жить без самомотивации, необходим VECTOR — держатель для канцелярских принадлежностей в виде графика бизнес-показателей. С одной стороны ломаная линия его бока красная (показатели падают, странно), с другой — зеленая (показатели растут, хорошо). Менеджер разворачивает VECTOR в зависимости от успехов бизнеса и держит на нем всякие рабочие мелочи <span style="font-size: 12pt;" times="" new="" roman="" ;=""></span>','','237','16554','2008-08-27 14:15:15'),
	('840','2632','3','Набор мягких игрушек RIDIBUNDUS',NULL,'плюш, пластик','13,5х25',NULL,NULL,NULL,NULL,'RIDIBUNDUS значит «улыбающийся». Для живого общения теперь тоже можно использовать смайлики. Выберите из разноцветного набора круглую подушечку с подходящей эмоцией и покажите, что вы думаете. Игрушка диаметром 13,5 см помещается на ладони или закрывает лицо. Смайлики можно разбросать в машине, на детской кровати, на полу или офисном столе','','712','16555','2008-08-27 14:15:15'),
	('841','2620.40','3','Бутылка 0,8 л с мячом-антистрессом (баскетбол), синяя',NULL,'пластик','26х7,5',NULL,NULL,NULL,NULL,'<p>Существует ряд вещей, которые сделать оригинальными, кажется, уже невозможно. Взять хоть бутылку-непроливашку. Пластиковая емкость, дозатор, укрепленная герметичная крышка. Как ни крути, куда ни роняй, содержимое бутылки не прольется. На этом функционал предмета, казалось бы, и заканчивается. </p><p>А если в середину корпуса вставлен мячик-антистресс? Любопытное дизайнерское решение делает предмет ярким, интересным и добавляет еще одну, «релаксирующую», функцию.</p>','','154','16638','2008-08-27 14:15:15'),
