	('885','2586','3','Набор для выживания',NULL,'пластик','5,5х7,3х2,5',NULL,NULL,NULL,NULL,'Этот мультифункциональный комплект просто начинен необходимыми предметами: 2 открывашки, нож, пила, фонарик, секундомер, таймер и компас выручат вас в трудную минуту или просто придадут оптимизма. Лямка с карабином позволит прицепить миниатюрный наборчик в удобном для вас месте, где он всегда будет под рукой. Мало ли что понадобится в следующую минуту? А тут, как ни крути, «8 в 1»!','','256','16584','2008-08-27 14:15:16'),
