	('968','2447.50','3','Фонарик на зажиме, красный',NULL,'пластик','6х5',NULL,NULL,NULL,NULL,'<br /><h4>Мнение эксперта</h4><br /> Изначально очень понравился.<br /> Но: предполагал использовать в авто,\r\nно не смог найти места, где смог бы его закрепить, слишком малый зажим.\r\nФонарик удалось включить не с первого раза; причина неясна, батарейки\r\nукладывали и так, и этак. Батарейки в пленке, которую не просто\r\nудалить, нужны определенные усилия. Очень смущает шарнир из пластика,\r\nибо его крепление к корпусу<br /> выглядит хлипковато, во всяком случае,\r\nпри повороте шарнира фонарь несколько раз отделялся от корпуса.\r\nДопускаю, что с этой вещицей надо быть более аккуратным, но мне нужны\r\nбыли настоящие полевые испытания.<br /><br />В целом после трех вечеров эксплуатации явных дефектов не нашел.<br /> <br /><span style="font-weight: bold;"> Плюсы</span><br /><ul><li> Современно</li><li> Выполнен в модном индустриальном стиле</li><li> Очень удобен при отсутсвии электричества за городом</li><li>Миниатюрен и легок</li><li> Зона освещенности устроила, интенсивость тоже</li><li> За время испытаний батарейки не сели (их там три типа часовых)</li><li> Возьму себе такой</li></ul><br /><span style="font-weight: bold;"> Минусы</span><br /><br /><ul><li>Зона для нанесения небольшая и не очень понятно, как сделать так, чтобы лого был виден всегда, впрочем, это мои сомнения</li></ul><br /><span style="font-weight: bold;">Итог: готов поставить 4+</span>. Можно и больше, если развеять мои сомнения по поводу персонализации.<br /><br /><br /><div style="text-align: right;"><span style="font-style: italic;">Сергей Пикус, компания «Иллан», Санкт-Петербург</span><br /></div>','','75','12688','2008-08-27 14:15:17'),
