	('973','2448','3','Тележка для багажа',NULL,'металл, пластик','29,5х16,5х6',NULL,NULL,NULL,NULL,'Сумка, чемодан, портплед... сколько всего приходится тащить с собой в деловую поездку. А какими мучениями становится поиск билетов или документов! Ведь надо поставить чемодан, положить портплед, копаться в тяжелой сумке, при этом держа ее на весу. К чему все это? Маленькая тележка для багажа (всего-то 30 см в высоту в сложенном состоянии) освободит вам руки, примет на себя до 18 килограммов груза и сделает путешествие простым и приятным.','','670','12473','2008-08-27 14:15:17'),
