	('1158','2374','3','Набор инструментов «6 в 1»',NULL,'пластик','3x2x14',NULL,NULL,NULL,NULL,'Отвертка с четырьмя насадками, уровень и LED-фонарик<br /><br /><br /><h4>Мнение эксперта</h4><br />На первый взгляд – банальная штука из разряда все включено, но только до тех пор пока не открываешь упаковку. <br />Это вещь!!<br />Взял\r\nее с собой на тусовку за город, в лес – и пригодилась, да еще как!\r\nОчень функционально. Что удивительно, неплохого качества. В составе\r\nдевайса: фонарик, уровень и набор из 4 отверток (двух крестовых и двух\r\nплоских). Причем размеры самые ходовые. Во всяком случае, разобрать\r\nкрепления плазменной панели удалось без труда.<br /><br /><span style="font-weight: bold;">Плюсы</span><br /><ul><li>Классная эргономика</li><li>Хорошо подогнаны детали, и ничего не гремит при ношении</li><li>Современный внешний вид (смотрится недешево)</li><li>Есть варианты по нанесению (клип и корпус)</li><li>Уровень не врет</li><li>Отвертки не ломаются, как некоторые китайские изделия после первого раза, удобный корпус</li><li>Фонарик дает широкую зону освещенности с модным ныне синим оттенком.</li><li>Удобно носить в кармане за счет клипа</li></ul>И\r\nвообще неплохой девайс для людей, не любящих набивать карманы всякой\r\nерундой, но мечтающих быть подготовленными ко всем превратностям жизни.\r\nНадо было видеть глаза прораба, который делал у нас в офисе очередной\r\nремонт, когда я проверял расположение стен по уровню – это было\r\nдостойно картины маслом. <br />Мне кажется, для любителей отдыха за городом и прочих любителей активного времяпрепровождения очень хорошая штучка.<br />Сомнения\r\nвызывает корпус изделия из пластика, в смысле предполагаемых царапин,\r\nно слишком мал был срок эксплуатации. Не понял, есть ли возможность\r\nменять батарейку фанарика.<br /><br /><span style="font-weight: bold;">Итог: твердая пятерка с минусом</span> (за предполагаемые царапины)<br /><br /><div style="text-align: right;"><span style="font-style: italic;">Сергей Пикус, компания «Иллан», Санкт-Петербург</span><br /></div>','','116','12471','2008-08-27 14:15:19'),
