	('1193','2360','3','CD-проигрыватель с FM-радиоприемником Mini Cooper',NULL,'пластик','40x18,8x16,5',NULL,NULL,NULL,NULL,'Выдвижной бампер открывает доступ к проигрывателю компакт-дисков. Под\r\nкапотом — панель управления. Стереоколонки мощностью по 2 Вт каждая\r\nрасположены в колесах.  <br />Имеется выход для\r\nнаушников или колонок<br /><br /><img src="http://www.gifts.ru/s/user/8F7xyBhn9JOj6RyK.jpg" /><br /><br />Примечание: для корректного закрывания и открывания двери багажника нажимайте с небольшим усилием на эмблему на двери до специфического щелчка, сигнализирующего о срабатывании замка.<br />','','3144','12462','2008-08-27 14:15:20'),
