	('1195','2362','3','Метеостанция с календарем и часами',NULL,'металл','9,5x9,5x18,4',NULL,NULL,NULL,NULL,'«У природы нет плохой погоды» - не так ли? Солнце, облака, дождь \r\nнеподвластны, но вполне предсказуемы.\r\n<br />\r\n<br />Настольная метеостанция – персональный погодный оракул – всегда \r\nпредупредит вас об изменениях в погоде. Загорелась на дисплее дождевая \r\nтучка – готовьте зонт, а появилось яркое солнышко – выгляньте в окно и \r\nулыбнитесь теплому деньку!\r\n<br />','','1533','12407','2008-08-27 14:15:20'),
