	('1197','2363','3','Часы с мировым временем, календарем и термометром',NULL,'металл','21,1x9x9',NULL,NULL,NULL,NULL,'<br />Современные средства коммуникации приблизили к нам самые отдаленные уголки планеты, и мир больше не кажется таким большим...<br /><br />Ваша компания расположена в Москве, а партнеры работают в  Гонконге? Франкфурте? Токио? Лондоне?<br />Часы с мировым временем отображают текущее время в мировых столицах. <br /><br />Поворачивая трехгранные блоки, вы можете  вывести на лицевую сторону часов индикацию времени в четырех из нижеперечисленных городов:<br /><br /><br /> <table border="0" align="center" style="width: 900px; height: 127px;"><tbody><tr><td style="text-align: left;"><ul><li style="text-align: left;">Москва</li><li>\r\nЧикаго</li><li>\r\nГонконг </li><li>\r\nЛос Анджелес</li><li>\r\nНью Йорк</li><li>\r\nТокио</li></ul></td><td><ul><li>\r\nЛондон</li><li>\r\nБангкок</li><li>\r\nСидней</li><li>\r\nФранкфурт</li><li>\r\nДенвер</li><li>\r\nГонолулу</li></ul></td></tr></tbody></table><br /><br />Название города, время в котором часы отображают в данный момент, подсвечивается изнутри.<br />Поворотом кольца на основании часов можно изменить один из четырех выбранных городов.<br /><br />Часы снабжены будильником, календарем (число, месяц, год, день недели, все дни месяца) и термометром. Красивая синяя подсветка.<br /><br />','','1389','12429','2008-08-27 14:15:20'),
	('1198','2364','3','Метеостанция с календарем и часами',NULL,'металл','22,3x7x7',NULL,NULL,NULL,NULL,'Показывает время и дату, температуру и влажность воздуха.<br />Пиктограммки демонстрируют текущее состояние атмосферы: ясно, переменно, облачно, дождь.<br />Будильник со snooze-функцией (отсрочка срабатывания сигнала).','','1294','12430','2008-08-27 14:15:20'),
