	('1203','2369','3','Набор: роллер, нож для бумаг, лупа',NULL,'металл, акрил','19х12х2,7',NULL,NULL,NULL,NULL,'В наборе использовано необычное покрытие предметов. Рисунок,\r\nнапоминающий голограмму, переливается хрустальными бликами, когда на\r\nнего падает свет. Именно это покрытие так привлекает внимание. Набор\r\nзаймет\r\nдостойное место на вашем рабочем столе, создаст атмосферу элегантной\r\nстрогой классики.','','0','12446','2008-08-27 14:15:20'),
