	('1227','2348','3','Пепельница «Кубики» с гасителем',NULL,'металл','5,4x5,4x5,4',NULL,NULL,NULL,NULL,'По функционалу все очень здорово, есть мулечки, которые позволяют\r\nположить сигарету и даже поставить вертикально, чтобы не сгорала. Мыть\r\nлегко. При закрытии дым идет недолго. На дне антискользящее покрытие.\r\nОтпечатки от потушенных сигарет не остаются. Места для лазерного\r\nнанесения – сколько хочешь. Рекомендую для компаний с эстетствующими\r\nзапросами. В принципе есть спец.масла, которые защищают такие\r\nповерхности, перед сдачей заказчику лучше обработать.<br /><br />За дизайн – 5<br />  За фунционал – 5<br />  За эксплуатацию – 4<br /><br />Сергей Пикус,<br />«Рекламная группа ILLAN»<br />','','419','12443','2008-08-27 14:15:20'),
