	('1231','2326','3','Брелок с электронным манометром, часами и фонариком',NULL,'пластик','8,7x4,6x2,1',NULL,NULL,NULL,NULL,'<br />Прибор расcчитан на измерение давления в диапазоне 0,35—10,5 кгс/см2.\r\n<br />Шаг измерения 0,05 кгс/см2\r\n<br />Измерение давления можно производить в:\r\n<br /><ul><li>кгс/см2\r\n</li><li>bar\r\n</li><li>kPa\r\n</li><li>PSI\r\n</li></ul>\r\n<br />Характеристики устройства:\r\n<br /><ul><li>точный цифровой манометр\r\n</li><li>сохранение данных последнего измерения давления в памяти устройства\r\n</li><li>ручное включение, автоматическое выключение после измерения давления в \r\nколесе\r\n</li><li>таймер обратного отсчета времени паркинга\r\n</li><li>супер-яркий LED-фонарик\r\n</li><li>индикатор разряда батарейки\r\n</li><li>часы и календарь\r\n</li><li>режим 12/24 часа\r\n</li><li>будильник со snooze-функцией на 5 минут\r\n</li><li>низкое потребление энергии</li></ul><br /><h4>Мнение эксперта</h4><br />Очень прикольная штука. <br />Многофункциональная.<br />Что поразило – ТАК ЭТО \r\nТОЧНОСТЬ ПОКАЗАНИЙ. <br />Удобен под брендирование. <br />Рекомендую всем \r\nавтолюбителям. Себе точно куплю:))) <br />Можно измерять давление в полной \r\nтемноте, при помощи специального фонарика, который светит туда, куда нужно.\r\n<br /><br /><div style="text-align: right;"><span style="font-style: italic;">Александр Баженов, директор компании «777», Москва</span><br /></div>','','0','12412','2008-08-27 14:15:20'),
