	('1241','2336','3','Зеркало складное',NULL,'пластик','9,4х7,4х1,4',NULL,NULL,NULL,NULL,'Раз! Два!! Три!!! <br /><br />Легким движением рук аккуратная серебристая\r\nкоробочка, напоминающая то ли эргономичную пудреницу, то ли\r\nновейший Palm-«наладонник», превращается в раскладное\r\nзеркало-«триптих». Крышка отходит назад, образуя удобную подставку, а\r\nзеркальные панели располагаются таким образом, что угол обзора\r\nпревышает 180 градусов, позволяя с максимальным комфортом нанести\r\nмакияж. Или, к примеру, побриться в походных условиях. <br /><br />Лицевая и тыльная поверхности\r\nизделия дают большой простор для фантазии всем желающим сделать это «умное»\r\nзеркальце частью корпоративного стиля – или оригинальным сувениром с\r\nсимволикой дарящего.','','190','12483','2008-08-27 14:15:20'),
