	('1251','2322','3','Настенные часы-термометр-барометр-гигрометр',NULL,'дерево','76,5x20x5,5',NULL,NULL,NULL,NULL,'Эти часы\r\nпоистине многофункциональны, помимо времени они показывают температуру\r\nвоздуха, влажность и атмосферное давление. Выполненные в прекрасном\r\nдеревянном корпусе, они органично впишутся в дизайн рабочего кабинета или гостиной в классическом стиле.','','3180','12436','2008-08-27 14:15:20'),
