	('1253','2324','3','Карточка для запоминания PIN-кодов',NULL,'пластик','8,6x5,5x0,5',NULL,NULL,NULL,NULL,'PIN-код для мобильного телефона, пароль для компьютера, код кредитной карты... Теперь не нужно держать эту информацию в голове. Умное устройство размером с пластиковую карту в нужный момент напомнит вам необходимый код доступа. Кроме того, его можно использовать в качестве калькулятора<br />','','156','12434','2008-08-27 14:15:20'),
	('1254','2325','3','Брелок-детектор WiFi-зоны',NULL,'пластик','3,1x5,8x1,1',NULL,NULL,NULL,NULL,'WiFi - технология беспроводного высокоскоростного доступа в Internet.<br /><br />Услуга доступна для пользователя в WiFi-зонах - местах установки специального оборудования, обеспечивающего уверенный прием и передачу сигнала, на коммерческой или бесплатной основе.<br /><br />Услуга интенсивно развивается, пользуется большой популярностью во всем мире среди пользователей сети Internet в силу неоспоримого удобства и легкого доступа в сеть.<br /><br />Чаще всего WiFi зоны можно встретить в залах ожидания аэропортов, престижных ресторанах и кафе, выставочных комплексах, крупных торговых центрах и т.п.<br /><br />Брелок-детектор позволяет быстро обнаружить наличие WiFi зоны и места наиболее уверенного приема сигнала.<br /><br />Для обнаружения зоны нажмите на кнопку SCAN.<br />Свет зеленого светодиода свидетельствует о наличии WiFi-сигнала.<br />Свет желтого светодиода сигнализирует о возможности устойчивой связи.<br />Свет красного светодиода и звуковой сигнал свидетельствуют о нахождении в месте наиболее уверенного приема сигнала.<br /><br />Дополнительная функция брелка - супер-яркий LED-фонарик.<br /> <br />Работает от двух батареек LR44 (поставляются в комплекте).  <br />','','372','12421','2008-08-27 14:15:20'),
