	('1422','2141.40','3','Магнитный клип-антистресс, синий',NULL,'пластик','одна деталь — 6,5х2,8х0,6',NULL,NULL,NULL,NULL,'Многие чувствуют себя комфортно, только когда вертят в руках\r\nкарандаш, ручку или безделушку. Магнитный клип-антистресс благодаря\r\nсвоим свойствам с легкостью затмит любые «талисманы» – он служит\r\nдобрую службу в офисной работе и дарит ощущение комфорта. Стоит хоть\r\nраз взять его в руки, как расстаться с ним уже невозможно.<br /><ul><li>Магнитный клип-антистресс выполнен из приятного на ощупь пластика и удобно «сидит» в руке.</li><li>При\r\nнажатии магнитный клип-антистресс издает очаровательные щелчки,\r\nпрогоняющие дурное настроение – остановиться чрезвычайно сложно.</li><li>В свободные минуты или во время беседы из нескольких клипов можно собрать цепочку или гирлянду.</li><li>Магнитный клип-антистресс с легкостью соединяет до 60 листов бумаги.</li><li>Благодаря\r\nмагниту клип-антистресс крепится к металлическим поверхностям,\r\nфиксирует напоминающие о важных делах записки, собирает вокруг себя\r\nскрепки и кнопки, наводя порядок на рабочем столе.</li></ul>Выбирайте, какой вам – <a href="http://www.gifts.ru/search?text=2141.40">синий</a> или белый?','','84','8126','2008-08-27 14:15:22'),
	('1423','2134','3','USB-флэш-карта на 128 Mb',NULL,'пластик','6,5х2,2',NULL,NULL,NULL,NULL,'В современном деловом мире сохранение и передача информации имеют решающее значение. USB-флэш-карта на 128 Mb станет в этом незаменимым помощником. Серебристый тубус отлично подходит для персонализации.','','0','8317','2008-08-27 14:15:22'),
