	('1437','2137','3','Мультифункциональные часы-будильник',NULL,'пластик','7,4х7,4х2,6',NULL,NULL,NULL,NULL,'Оригинальное мультифункциональное устройство: часы, календарь, таймер прямого и обратного отсчета с сигнализацией окончания отсчета. Переключение режимов производится вращением часов – просто поставьте их на сторону, отмеченную соответствующей пиктограммой. Функция сигнализации: семь мелодий и бипер. Таймер прямого и обратного отсчетов: максимальное время таймера – 99 часов 99 минут. Календарь: год, месяц, день месяца, день недели','','147','8320','2008-08-27 14:15:22'),
