	('1445','2126','3','Автоматический пылесос SMART CLEANER',NULL,'пластик','36х38х8',NULL,NULL,NULL,NULL,'Автоматический пылесос <span style="font-weight: bold;">SMART CLEANER</span>,\r\nчто в переводе означает «умный уборщик», не зря носит это имя. Это чудо\r\nинженерной мысли объединило в себе «интеллектуальную» электронику,\r\nкомпактность и эргономичный дизайн. <span style="font-weight: bold;">Достижение XXI века у Вас дома – робот-пылесос!</span><br style="font-weight: bold;" /><span style="font-weight: bold;"> </span><br /><span style="font-weight: bold;">SMART CLEANER</span>\r\nсамостоятельно, без помощи человека, передвигается по комнате, убирая\r\nпыль с кафеля, паркета и других покрытий. Любые препятствия – мебель,\r\nпредметы интерьера, стены – для него не помеха. <span style="font-weight: bold;">SMART CLEANER</span> определяет их, приближаясь вплотную, и разворачивается, при этом процесс уборки ни на секунду не прекращается. <br /><br />Упасть с лестницы способен любой, но только не автоматический пылесос <span style="font-weight: bold;">SMART CLEANER</span>.\r\nОбладая размерами с книгу (36х38х8 см), он поразительно умен и\r\nсамостоятелен - достаточно нажать на кнопку и забыть об уборке в доме. <span style="font-weight: bold;">SMART CLEANER</span> выполнит ее на «отлично».<br /><br />Специальное\r\nустройство «виртуальная стена», которое входит в комплект поставки,\r\nгенерирует невидимый глазу луч, подсказывая, где остановиться и\r\nповернуть в обратную сторону. Таким нехитрым образом площадь\r\nперемещения пылесоса можно ограничить. Менее чем за час <span style="font-weight: bold;">SMART CLEANER</span> справится с уборкой двух средних по размеру комнат. <br /><span style="font-style: italic;"></span>','<span style="font-style: italic;">Три режима работы: </span><br style="font-style: italic;" /><span style="font-style: italic;">S: время работы 30 минут. Площадь очищаемой поверхности 10—15 кв.м.</span><br style="font-style: italic;" /><span style="font-style: italic;">M: время работы 40 минут. Площадь очищаемой поверхности 15—25 кв.м.</span><br style="font-style: italic;" /><span style="font-style: italic;">L: время работы 60 минут. Площадь очищаемой поверхности свыше 25 кв.м.</span><br style="font-style: italic;" /><br style="font-style: italic;" /><span style="font-style: italic;">Устройство </span><span style="font-style: italic;">«</span><span style="font-style: italic;">виртуальная стена</span><span style="font-style: italic;">»</span><span style="font-style: italic;">.\r\nПредназначено для ограничения площади обрабатываемой пылесосом\r\nповерхности. Устройство генерирует невидимый человеческим глазом луч,\r\nкоторый улавливает сенсор пылесоса, заставляя его повернуть обратно. </span><br style="font-style: italic;" /><span style="font-style: italic;">«Виртуальная стена» имеет три режима:</span><br style="font-style: italic;" /><span style="font-style: italic;">- действие луча 3 м</span><br style="font-style: italic;" /><span style="font-style: italic;">- действие луча 3—7 м</span><br style="font-style: italic;" /><span style="font-style: italic;">- действие луча свыше 7 м</span><br style="font-style: italic;" /><span style="font-style: italic;"><br />Время зарядки аккумулятора 4—5 часов, время работы на полностью заряженном аккумуляторе от 30 до 60 минут. <br />В\r\nкомплекте поставляются: устройство «виртуальная стена», дополнительный\r\nфильтр, дополнительная боковая щетка, ложка для очистки контейнера,\r\nзарядное устройство.</span>','4706','8302','2008-08-27 14:15:22'),
	('1446','2127','3','Наручные часы на солнечной батарее',NULL,'пластик','24,2x3,6x1',NULL,NULL,NULL,NULL,'Применение специального аккумулятора высокой емкости в комбинации<br />с солнечной батареей позволяет уникальным часам работать практически вечно!<br />Про батарейки можно забыть. Часы водонепроницаемые, работают на глубине до 10 метров','','147','8303','2008-08-27 14:15:22'),
