	('1450','2130','3','Диктофон на магнитной основе',NULL,'пластик','5,5х5,5х1,8',NULL,NULL,NULL,NULL,'Нужно оставить сообщение для коллег или членов семьи, но нет времени, чтобы записать? Оставьте сообщение на компактном цифровом диктофоне, положите его на стол или прикрепите к металлической поверхности, и адресат получит ваше послание! Время записи 10 секунд. Индикатор записи и воспроизведения. Комплектуется источником питания.','','245','8313','2008-08-27 14:15:22'),
	('1451','2131','3','«Говорящий фотоальбом» на 72 фотографии',NULL,'пластик','футляр 19,6х11, плеер 13,6х11,8х2,9',NULL,NULL,NULL,NULL,'Каждая фотография – это маленькая история, и говорящий фотоальбом рассказывает историю длиною в жизнь...<br />В\r\nкомплект входят бокс, 72 карточки для хранения фотографий и\r\nрамка-проигрыватель. Вставьте фото в карточку-холдер, а карточку – в\r\nпроигрыватель, и запишите сообщение, соответствующее фотографии. Это\r\nможет быть ваш рассказ, голос ребенка, голос любимого человека.\r\nСообщения (продолжительность каждого – не более 10 сек.) останутся в\r\nпамяти электронного проигрывателя на многие годы (гарантия\r\nпроизводителя – более 100 лет), даже если в нем не будет батареек. Для\r\nвоспроизведения вставьте любую из карточек в рамку. Каждая\r\nкарточка-холдер имеет свой персональный код, распознаваемый\r\nрамкой-проигрывателем. Нажмите на кнопку. Маленькая история зазвучит, и\r\nпрошлое станет ближе...<br /><br />Рамку-проигрыватель можно ставить вертикально или горизонтально. Устройство подходит для фотографий размером 10х15 см.','','1864','8314','2008-08-27 14:15:22'),
