	('1657','1994','3','Аэродиск «НЛО»',NULL,'пластик','22,5',NULL,NULL,NULL,NULL,'Прекрасный способ развлечься. Играйте вместе с детьми! Диск из легкого материала взлетает на несколько метров, дистанционно управляется с пульта. Оригинальный подарок для любителей активного отдыха.','','1595','8210','2008-08-27 14:15:25'),
	('1658','1995','3','«Амфибия»',NULL,'пластик','26х24х13',NULL,NULL,NULL,NULL,'<p>«Амфибия»&nbsp;– не просто игрушка или развлечение, а самый настоящий пляжный помощник. Он может нести за вас несколько банок напитков, и будьте уверены – он от вас не отстанет, ведь максимальная скорость при движении по суше достигает 25 км/ч! Лихо? А как вам такой факт: скорость движения по воде 1,5 км/ч? На водных лыжах он вас, конечно, не потянет, но окружающих позабавит, это точно. У вас не будет отбоя от желающих познакомится и рассмотреть игрушку поближе. Прием сигнала от пульта управления осуществляется на двух каналах. Это позволяет одновременно двум игрокам управлять разными амфибиями. \r\n  <br /> \r\n  <br />После включения кнопки «Свет» постоянно горят фары и габаритные огни. Все четыре колеса ведущие, движение вперед-назад осуществляется по принципу гусеничного танка: одновременным нажатием двух кнопок управления правым и левым двигателем вездехода. При нажатии на одну кнопку машина делает крутой разворот на месте, при одновременном нажатии на кнопки: правой – вперед, левой – назад амфибия разворачивается на 360 градусов на месте. Колеса амфибии объединены попарно с правого и левого бока в поворотные блоки, что позволяет модели по команде с пульта управления «превращаться» в катер или обратно в вездеход. Причем, трансформация не требует остановки машины.&nbsp; \r\n</p>\r\n<p>Аккумулятор (700 мА-ч) заряжается в течение 3—4 часов. Время работы от одной зарядки 25 минут\r\n</p>','','1603','8211','2008-08-27 14:15:25'),
