	('1729','1929','3','Антистресс «Футбол»',NULL,'вспененный каучук, пластик; 2 ААА (не комплектуется)','23х14 см, мяч — 9,5',NULL,NULL,NULL,NULL,'Неважно, кто мы и чем занимаемся, – нас всех объединяет любовь к футболу. Оле-оле-оле-оле! Антистресс «Футбол» станет оригинальным настольным подарком. Крепится к плоской поверхности. При ударе по мячу звучит всемирно известный клич!','','590','8171','2008-08-27 14:15:26'),
	('1730','1930','3','Антистресс «Боксерская груша мини»',NULL,'вспененный каучук, пластик; 2 ААА (не комплектуется)','13х7,5см, груша — 4,5',NULL,NULL,NULL,NULL,'Мини-аналог популярного антистресса «Боксерская груша». Крепится к плоской поверхности. При удачном ударе звучит рев восхищенного зала! Оригинальный сувенир для мужчин<br />','','178','8172','2008-08-27 14:15:26'),
	('1731','3760','3','DRIVEMOCION 2',NULL,'пластик','24x16,3x3,8',NULL,NULL,NULL,NULL,'Внимание! Ввод персонализированных сообщений возможен только в процессе производства изделия на заводе-изготовителе. Минимальный тираж составляет 500 шт.\r\n\r\n<br /><br />Часто ли вы включением аварийных сигналов выражали благодарность водителю, пропустившему вас вперед в автомобильной пробке?\r\n  А что если нужно не поблагодарить, а выразить другие эмоции? Вашими аргументами становятся громкие крики и красноречивые жесты? Не нужно тратить нервные клетки, поручите это DRIVEMOCION.\r\nDRIVEMOCION – великолепный прибор, позволяющий показать ваши чувства водителю идущей позади машины. Несколько встроенных в память сообщений появляются на светодиодном дисплее, прикрепленном к заднему стеклу автомобиля. Активируются они нажатием на одну из кнопок дистанционного пульта, который можно поместить в любое легко доступное для водителя место в салоне.\r\n  <br /><br />Не надо брани, не надо жестов – будьте цивилизованнее, просто нажмите кнопку!','2 сообщения в памяти','2057','22188','2008-08-27 14:15:26'),
	('1732','1931.00','3','Универсальное зарядное устройство',NULL,'пластик','8,1х5,9х2,1',NULL,NULL,NULL,NULL,'<p> Невероятно! Уникальный подарок для всех пользователей электронных устройств и цифровой техники. Где бы вы ни находились: дома, в офисе, в дороге или даже во время отдыха на природе — вы можете зарядить: мобильный телефон (SonyEricsson, Nokia, Siemens, Samsung), MP3 или CD-плеер, радио, цифровой фотоаппарат, карманный компьютер и другую портативную технику. Источником питания для зарядного устройства может служить бытовая сеть, автомобильный прикуриватель или встроенная солнечная батарея.\r\n</p>\r\n<p>Полный список всех электронных устройств, совместимых с артикулом, Вы найдете в <b>Приложении</b>.\r\n  <br />\r\n  <br />Устройство предназначено для зарядки мобильных телефонов или портативной электронной техники (цифровой фотоаппарат, MP3 - плейер и т.п.). \r\n  <br />Основное предназначение данного устройства - подзарядка портативной электронной техники от альтернативных источников энергии, когда недоступна зарядка от штатного зарядного устройства. Например, на природе, во время путешествия на автомобиле и т.п. \r\n  <br /> \r\n  <br />Устройство имеет собственную батарею и солнечные элементы. \r\n  <br /> \r\n  <br />\r\n</p>\r\n<h4>Зарядка батареи устройства осуществляется: \r\n</h4>\r\n<ul>\r\n  <li>от солнечной энергии \r\n  </li>\r\n  <li>от бытовой электросети (шнур в комплекте) \r\n  </li>\r\n  <li>от автомобильного прикуривателя (шнур в комплекте) \r\n  </li>\r\n</ul> \r\n<br />\r\n<h4>Зарядка портативной электронной техники от устройства осуществляется: \r\n</h4>\r\n<ul>\r\n  <li>при использовании солнечной батареи: \r\n  </li>\r\n</ul>Время экспозиции (ч): 1.5 4 10 \r\n<br />Время передачи (мин): 15 30 50 \r\n<br />Режим ожидания (ч): 4 10 18 \r\n<br />Режим разговора (мин): 5 10 25 \r\n<br />\r\n<ul>\r\n  <li>при использовании от бытовой электросети: \r\n  </li>\r\n</ul>Вольтаж: 110-240V \r\n<br />Время зарядки устр. (ч): 4 \r\n<br />Время передачи (ч): 1 \r\n<br />Режим ожидания (ч): 24 \r\n<br />Режим разговора (мин): 30 \r\n<br />\r\n<ul>\r\n  <li>при использовании от автомобильного прикуривателя: \r\n  </li>\r\n</ul>Вольтаж: 12V \r\n<br />Время зарядки устр. (ч): 4 \r\n<br />Время передачи (ч): 1 \r\n<br />Режим ожидания (ч): 24 \r\n<br />Режим разговора (мин): 30 \r\n<br /> \r\n<br />*приведены результаты измерений для телефона Nokia 8250 \r\n<br />**результат зарядки от солнечной батареи может варьироваться в зависимости от интенсивности солнечного излучения (в свою очередь зависит от облачности и высоты солнца над горизонтом) \r\n<br />***рекомендуемое время экспозиции устройства при зарядке собственной батареи от солнечных элементов - не менее 1,5 h \r\n<br /> \r\n<br />\r\n<h4>Спецификация: \r\n</h4>\r\n<ul>\r\n  <li>Солнечные элементы – 2 штуки, размер каждой 56*48мм \r\n  </li>\r\n  <li>Емкость собственной батареи – 600mAh \r\n  </li>\r\n  <li>Ток зарядки 60mAh \r\n  </li>\r\n  <li>Напряжение (на выходе устройства) 5,5 V \r\n  </li>\r\n  <li>Количество циклов зарядки – не менее 500 \r\n  </li>\r\n  <li>Вес устройства – 88 г \r\n  </li>\r\n</ul>','','1731','19977','2008-08-27 14:15:26'),
