	('1812','1760.20','3','Скакалка, оранжевая',NULL,'пластик','330х13,5х5,5',NULL,NULL,NULL,NULL,'Нет времени на посещение фитнес-клуба? Есть альтернатива – скакалка с подсчетом количества прыжков и израсходованных калорий. Занимайтесь спортом когда угодно и где угодно.<br /><br /><br />Хорошая вещь. Сейчас очень популярна тема спорта и фитнеса. Плюс современные технологии. И цвета удачные, синий – № 1 из корпоративных.<br /><br />Ирина Афанасьева,<br />«Кьюти-дизайн»<br /><br /><br />Мне было бы приятно, если бы мой фитнес-клуб (пусть пока виртуальный) подарил бы мне такой подарок! Примерились, попрыгали. Отлично, что ее по длине можно регулировать, и действительно сразу «видишь результат». Понимаешь, сколько «выпрыгал» в количестве прыжков, а самое приятное – сколько калорий в минусе!!!<br /><br />Татьяна Маркалова,<br />«Magic Gifts»<br />','','182','4439','2008-08-27 14:15:27'),
