	('2024','1778','3','Персональный ионизатор воздуха с фонариком',NULL,'пластик','9х7х3',NULL,NULL,NULL,NULL,'Портативный ионизатор генерирует триллионы отрицательно заряженных ионов, которые способствуют удалению из воздуха бактерий, пыли и различных аллергенов. В поезде, самолете или автомобиле, в офисных помещениях и в домах он очищает и дезодорирует воздух, делая ваше дыхание свободным. Ионизированный воздух облегчает симптомы астмы, болезней дыхательных путей, уменьшает аллергические реакции, снимает напряжение и способствует концентрации внимания.\r\n<br />\r\n<br />Питание устройства возможно от USB-порта компьютера или от обычных пальчиковых батареек.\r\n<br />\r\n<br />\r\n<ul>\r\n  <li>фонарик с тремя LED-лампами и поворотным механизмом\r\n  </li>\r\n  <li>ланъярд\r\n  </li>\r\n</ul>','','498','4561','2008-08-27 14:15:29'),
