	('2078','1715','3','Обложка для автодокументов и паспорта',NULL,'кожа','14х9,8х1,5',NULL,NULL,NULL,NULL,'Незаменимый аксессуар вмещает в себя: водительское удостоверение (для этого в прозрачном кляссере под размер «прав» отформован кармашек, фиксирующийся «липучкой»), свидетельство о регистрации ТС, талон техосмотра, есть удобный сворачивающийся кармашек для доверенности. Дальше интереснее: отдел для паспорта, кармашки для пластиковых карточек, кармашки для визиток и прочей бумажной мелочевки. Изготовлено из кожи очень приличного качества, спокойно выдержало тест-драйв продолжительностью в год и, судя по состоянию, готово еще к нескольким таким забегам. Кожа отлично поддается тиснению, поэтому не придется прибегать к лазерному «суррогату». Не рекомендуется рассеянным и забывчивым людям – можно потерять сразу очень много важных документов.<br /><br />Роман Гельфанд,<br />Сувенирная Компания «ПУСК»<br /><br />','','581','4397','2008-08-27 14:15:30'),
