	('2173','1843','3','Металлоискатель',NULL,'пластик, металл','84х13,5',NULL,NULL,NULL,NULL,'Потерялись ключи или мобильный телефон? <br />Нужно определить местоположение проводки в стене? <br />Собрались на поиски древнего клада, или задача проще – найти иголку в стоге сена? <br />Металлоискатель\r\nпозволяет обнаружить скрытые металлические предметы, которые невозможно\r\nобнаружить путем визуального контакта, и определить их местонахождение.','Настройка прибора осуществляется двумя ручками управления: <br />ручка грубой настройки, находится на левой стороне рукоятки прибора; ручка тонкой настройки, находится на правой стороне рукоятки прибора. Ручка тонкой настройки является также ручкой включения/выключения прибора. <br /><br />Последовательность действий при настройке: <br />Включить прибор и установить ручку тонкой настройки на среднюю чуствительность. Настроить чуствительность прибора ручкой грубой настройки по металлическому предмету предполагаемого поиска. Для этого кольцо металлоискателя направить на металлический предмет, вращать ручку грубой настройки до появления сигнала. <br />Обратным вращением ручки определить порог чуствительности для детекции в данных условиях: металл - среда - расстояние. <br />Ручкой тонкой настройки сделать настройку оптимальной чуствительности прибора. <br /><br />Телескопическая ручка позволяет увеличивать длину штока прибора в два раза, что сделает поиск комфортным. <br /><br />Для\r\nболее успешного результата рекомендуется в процессе сканирования\r\nперемещать кольцо металлоискателя параллельно исследуемой поверхности <br /><br />','710','4370','2008-08-27 14:15:31'),
