	('2191','1629','3','Часы-будильник «Пружина»',NULL,'металл','14х6х6',NULL,NULL,NULL,NULL,'Интересно, кто придумал поместить хронометр на пружину?<br /><br />Имени этого \r\nгения мы, видимо, уже не узнаем, но совершенно точно то бы гений: \r\nникакому мобилю не под силу достичь того антистрессового эффекта, какой \r\nзапросто получаем здесь – всего-то и нужно, слегка толкнуть негромко \r\nтикающие часики. <br />Время идет – и перед глазами успокаивающе покачивается \r\nего вполне материальное воплощение - серый металлический диск…\r\n<br /><br />Во время, когда все болезни, по единодушному убеждению врачей, идут от \r\nнервов, пренебрегать таким простым и одновременно действенным \r\n«лекарством» ну совершенно не резон.','','0','4329','2008-08-27 14:15:31'),
