	('2197','3606.40','3','Радиоприемник «Model One», Tivoli Audio',NULL,'деревянный корпус ручной работы','19,5х15,5х26',NULL,NULL,NULL,NULL,'<p>Конструкция радиоприемника <span style="font-weight: bold;">Model One</span> от <span style="font-weight: bold;">Tivoli Audio (США)</span> – синтез современных электронных технологий и принципов дизайна, которые использовались в 1960 – 1970-е.<br />Гла<img align="right" src="/s/user/QBPcRPqzTmofqR9P.jpg" />вная и единственная задача <span style="font-weight: bold;">Model One</span>\r\n– качественное воспроизведение радио, поэтому его функции более чем\r\nпросты. На передней панели вы не увидите цифрового дисплея. Здесь\r\nрасположены лишь три переключателя – поворотное реле включения и\r\nпереключения волн AM/FM-ручка регулировки громкости и ручка настройки\r\nчастот.<br />Качеству приема станций этой новинки могут позавидовать самые продвинутые системы. <span style="font-weight: bold;">Модель оснащена электронным тюнером</span>,\r\nвпервые использующимся в радиотехнике (технология, на которой\r\nбазируется тюнер, была изначально разработана для сотовых телефонов). <br />Хотя в радиоприемнике используется моноколонка, это не лишает его качественного звучания. Корпус <span style="font-weight: bold;">Model One</span> сделан из натурального дерева. Благодаря этому радио смотрится привлекательно, а окраска звука остается нейтральной. Наличие <span style="font-weight: bold;">фазоинвертора</span>, который обычно используется только в дорогих аудиосистемах, позволяет наиболее полно воспроизводить басы. <br />В <span style="font-weight: bold;">Model One</span>\r\nпредусмотрен вход для дополнительных устройств, таких как CD или\r\nкассетный проигрыватель. Кроме того, к радиоприемнику могут быть\r\nподключены наушники или записывающее устройство.<br /><span style="font-weight: bold;"></span><br /></p>','','0','4286','2008-08-27 14:15:31'),
	('2198','3606.60','3','Радиоприемник «Model One», Tivoli Audio',NULL,'деревянный корпус ручной работы','19,5х15,5х26',NULL,NULL,NULL,NULL,'<p>Конструкция радиоприемника <span style="font-weight: bold;">Model One</span> от <span style="font-weight: bold;">Tivoli Audio (США)</span> – синтез современных электронных технологий и принципов дизайна, которые использовались в 1960 – 1970-е.<br />Глав<img align="right" src="/s/user/BH7gEJhePgJfHFrk.jpg" />ная и единственная задача <span style="font-weight: bold;">Model One</span> – качественное воспроизведение радио, поэтому его функции более чем просты.  На передней панели вы не увидите цифрового дисплея. Здесь расположены лишь три переключателя – поворотное реле включения и переключения волн AM/FM-ручка регулировки громкости и ручка настройки частот.<br />Качеству приема станций этой новинки могут позавидовать самые продвинутые системы. <span style="font-weight: bold;">Модель оснащена электронным тюнером</span>, впервые использующимся в радиотехнике (технология, на которой базируется тюнер, была изначально разработана для сотовых телефонов). <br />Хотя в радиоприемнике используется моноколонка, это не лишает его качественного звучания. Корпус <span style="font-weight: bold;">Model One</span> сделан из натурального дерева. Благодаря этому радио смотрится привлекательно, а окраска звука остается нейтральной. Наличие <span style="font-weight: bold;">фазоинвертора</span>, который обычно используется только в дорогих аудиосистемах, позволяет наиболее полно воспроизводить басы. <br />В <span style="font-weight: bold;">Model One</span> предусмотрен вход для дополнительных устройств, таких как CD или кассетный проигрыватель. Кроме того, к радиоприемнику могут быть подключены наушники или записывающее устройство.<br /><br /></p>','','0','4285','2008-08-27 14:15:31'),
	('2199','3606.90','3','Радиоприемник «Mode One», Tivoli Audio',NULL,'деревянный корпус ручной работы','19,5х15,5х26',NULL,NULL,NULL,NULL,'Конструкция радиоприемника <span style="font-weight: bold;">Model One</span> от <span style="font-weight: bold;">Tivoli Audio (США)</span> – синтез современных электронных технологий и принципов дизайна, которые использовались в 1960 – 1970-е.<br />Гла<img align="right" src="/s/user/gO9eND5OlicComWh.jpg" />вная и единственная задача <span style="font-weight: bold;">Model One</span>\r\n– качественное воспроизведение радио, поэтому его функции более чем\r\nпросты. На передней панели вы не увидите цифрового дисплея. Здесь\r\nрасположены лишь три переключателя – поворотное реле включения и\r\nпереключения волн AM/FM-ручка регулировки громкости и ручка настройки\r\nчастот.<br />Качеству приема станций этой новинки могут позавидовать самые продвинутые системы. <span style="font-weight: bold;">Модель оснащена электронным тюнером</span>,\r\nвпервые использующимся в радиотехнике (технология, на которой\r\nбазируется тюнер, была изначально разработана для сотовых телефонов). <br />Хотя в радиоприемнике используется моноколонка, это не лишает его качественного звучания. Корпус <span style="font-weight: bold;">Model One</span> сделан из натурального дерева. Благодаря этому радио смотрится привлекательно, а окраска звука остается нейтральной. Наличие <span style="font-weight: bold;">фазоинвертора</span>, который обычно используется только в дорогих аудиосистемах, позволяет наиболее полно воспроизводить басы. <br />В <span style="font-weight: bold;">Model One</span>\r\nпредусмотрен вход для дополнительных устройств, таких как CD или\r\nкассетный проигрыватель. Кроме того, к радиоприемнику могут быть\r\nподключены наушники или записывающее устройство.<br />','','0','4287','2008-08-27 14:15:31'),
	('2200','3607.40','3','Радиоприемник «PAL», Tivoli audio',NULL,'пластик','',NULL,NULL,NULL,NULL,'<span style="font-weight: bold;">Стиль, который вы можете захватить с собой</span><br /><br />Хотите наслаждаться фирменным звучанием <span style="font-weight: bold;">TIVOLI </span>даже на улице? Все возможно, если у вас есть <span style="font-weight: bold;">PAL</span>!<br />2.5-дюймовый\r\nдинамик и приятный на ощупь корпус из пластика с добавлением резины\r\nабсолютно неподвластны брызгам воды или повышенной влажности, поэтому <span style="font-weight: bold;">PAL</span> может составить вам компанию даже около бассейна или на пляже.<br /><span style="font-weight: bold;">PAL</span>\r\nможно подключить к сети, но главное его преимущество – работа от\r\nбатареи. Безопасная для окружающей среды никелевая батарея,\r\nобеспечивающая питание <span style="font-weight: bold;">PAL</span>,\r\nполностью заряжается за 2 – 2.5 часа и обеспечивает 20 часов\r\nбеспрерывной работы без остановки и подзарядки. Батарея не обладает\r\n«эффектом памяти», поэтому заряжать ее можно, даже если радио еще не\r\nполностью разрядилось. Индикатором подключения к сети и уровня заряда\r\nбатареи является маленькая зеленая лампочка, расположенная на передней\r\nпанели приемника. <br />Простой и точной настройке служит <span style="font-weight: bold;">аналоговый тюнер</span> с точностью 5:1. Радиоприемник оснащен системой <span style="font-weight: bold;">Automatic Frequency Control</span>,\r\nкоторая фиксирует центр частоты, на которой вещает радиостанция, тем\r\nсамым снижая уровень искажений и повышая качество сигнала. Точный прием\r\nFM-радиостанций обеспечивает <span style="font-weight: bold;">телескопическая внешняя антенна</span>\r\n(если приемник уверенно ловит радиостанции и без ее помощи, вы можете\r\nсложить антенну и закрепить ее на задней панели корпуса). За\r\nAM-диапазон отвечает встроенная AM-антенна. <br />Вспомогательный вход\r\nдля подключения CD- или MP3-проигрывателя закрыт специальным резиновым\r\nклапаном. Так же защищен и выход на наушники. Кстати, если в обычном\r\nрежиме <span style="font-weight: bold;">PAL</span> предлагает воспроизведение в режиме моно, то, <span style="font-weight: bold;">подключив к нему наушники, вы получите настоящее стерео</span>. Этот же выход может быть использован для коммутации <span style="font-weight: bold;">PAL</span> с записывающим устройством.<br />\r\n<img src="http://www.gifts.ru/s/user/OB6qpHT0CUTo9CYC.jpg" vspace="0" hspace="20" align="right" />\r\nТехнологические решения, примененные в <span style="font-weight: bold;">PAL</span>,\r\nсделали его обладателем одной из самых престижных наград – звания\r\n«Лучшая покупка» в рамках Sound &amp; Vision Awards 2003 журнала What\r\nHI-FI? (категория «Портативное радио»). Но наибольшее удивление и\r\nвосхищение вызывает в <span style="font-weight: bold;">PAL</span> его богатое звучание. Когда вы смотрите на его компактный корпус, размеры которого составляют всего <span style="font-weight: bold;">160 х 90 х 98 мм</span>, это кажется невероятным. Чтобы поверить в это, нужно хотя бы раз услышать <span style="font-weight: bold;">PAL</span>.\r\nБлагодаря возможности подключения к сети 12 V PAL можно использовать и\r\nв автомобиле, на борту катера или яхты. Корпус радиоприемника оснащен\r\nмаленькими ножками, поэтому он будет устойчив на любой плоской\r\nповерхности.<br />Палитра цветов, в которых представлен <span style="font-weight: bold;">PAL</span>,\r\nчрезвычайно широка. Он словно создан для того, чтобы быть душой\r\nкомпании. Разбегаются глаза от такого разнообразия цветов? Почему бы не\r\nсобрать полную коллекцию этих замечательных радиоприемников?! В любом\r\nслучает, <span style="font-weight: bold;">PAL</span> никогда не будет лишним!<br />','','0','4288','2008-08-27 14:15:31'),
