	('2340','1568','3','Хьюмидор',NULL,'розовое дерево','25х21,5х12,5',NULL,NULL,NULL,NULL,'<br />Вас манит далекая и удивительная Бразилия, о которой, по-хорошему\r\nговоря, всего только и известно, что в лесах там водится много-много\r\nдиких обезьян? <br /><br />Тогда настала пора обзавестись бразильской народной\r\nпривычкой – курить сигары! Что решительно невозможно без хьюмидора\r\n(ведь всякая привычка сильна ритуалом): роскошная деревянная коробка\r\nпозволит не просто сохранить в неприкосновенности и постоянной\r\nготовности к использованию элитные сорта сигар, но и организует для них\r\nнаилучшие условия «проживания». <br /><br />Герметичность, поддержание в\r\nнеизменности оптимальных температуры и влажности, удобные полочки,\r\nаромат нездешнего шика – что еще нужно настоящему сибариту? <br /><br />P.S. Одно\r\nтолько слово ХЬЮ-МИ-ДОР - уже само по себе настоящий подарок! Это вам\r\nне скучный «Parker» или набившая оскомину «Ferrari»...\r\n<br />','','3095','3479','2008-08-27 14:15:33'),
	('2341','1569','3','Часы-проектор, часы, будильник, термометр',NULL,'металл','15,8х10х8',NULL,NULL,NULL,NULL,'Часы-будильник с календарем и термометром. Синяя подсветка циферблата и проекция показателей времени и температуры воздуха на потолок или на стену включаются легким ударом ладони по циферблату или по поверхности стола, а также при срабатывании будильника.<br />','','1466','3613','2008-08-27 14:15:33'),
	('2342','1570','3','Метеостанция-проектор, часы, будильник, календарь',NULL,'металл','13х9х14,5',NULL,NULL,NULL,NULL,'Часы-будильник с календарем и погодной станцией: атмосферное давление, температура и влажность воздуха, состояние погоды (ясно, облачно, дождь) обозначаются с помощью пиктограмм. Синяя подсветка циферблата включается легким ударом ладони по циферблату или по поверхности стола. При включенной подсветке время и температура воздуха проецируются на потолок или на стену.','','1639','3614','2008-08-27 14:15:33'),
	('2343','1571','3','Метеостанция «Лист»',NULL,'металл','20х15х5',NULL,NULL,NULL,NULL,'Часы-будильник с календарем и погодной станцией. Показывает атмосферное давление, температуру и влажность воздуха, состояние погоды (ясно, облачно, дождь – обозначается с помощью пиктограмм). Часы можно использовать как настольные, а можно крепить на стену. Синяя подсветка циферблата включается легким ударом ладони по циферблату или по поверхности стола.','','2057','3615','2008-08-27 14:15:33'),
