	('2499','1425.40','3','Плед, синий',NULL,'флис','160х125',NULL,NULL,NULL,NULL,'Как прекрасно, засидевшись где-нибудь за городом, вечерком укутаться в теплый, приятный на ощупь плед! Поэтому он обязательно должен присутствовать в машине любого уважающего пикники человека! <br />И что приятно – он не валяется в багажнике и не пачкается о лежащие там же мангалы, шампуры и т.д., а лежит в своем чехле и при этом занимает совсем немного места. Я считаю плед отличным сувениром, так как им действительно будут пользоваться, а логотип всегда будет напоминать о том, кто сделал такой приятный и полезный подарок.<br /><br />Татьяна Маркалова,<br />«Magic Gifts»<br />','','656','3400','2008-08-27 14:15:35'),
