	('2554','1387','3','Набор чайный/кофейный TRAMONTINA',NULL,'металл','чашка: D=8,7 см; H=7 см, 180 мл,  блюдце: D=14,4 см, ложечка: L=14 см, коробка: 19,5х19,5х10,5',NULL,NULL,NULL,NULL,'Компания Tramontina была основана Валентином Трамонтина в городке Карлос Барбоса на юге Бразилии почти 100 лет назад. Сегодня Tramontina – это 10 фабрик, выпускающих более 17.000 наименований высококачественных современных товаров для кухни.<br />Представительства этой марки работают более чем в 120 странах мира.<br />Компания удостоена международного сертификата ISO 9001: 2000, который подтверждает соответствие продукции высочайшим стандартам качества на всех этапах ее производства и контроля.<br /><br /><br />Кружки из двухслойного металла долго сохраняют напиток горячим и не обжигают губы','На одну персону','898','2580','2008-08-27 14:15:35'),
	('2555','1388','3','Набор кофейный TRAMONTINA',NULL,'металл','чашка: D=6 см; H=5,2 см, 50 мл, блюдце: 11,6х11,6х0,6 см, ложка: L=10,2',NULL,NULL,NULL,NULL,'Компания Tramontina была основана Валентином Трамонтина в городке Карлос Барбоса на юге Бразилии почти 100 лет назад. Сегодня Tramontina – это 10 фабрик, выпускающих более 17.000 наименований высококачественных современных товаров для кухни.<br />Представительства этой марки работают более чем в 120 странах мира.<br />Компания удостоена международного сертификата ISO 9001: 2000, который подтверждает соответствие продукции высочайшим стандартам качества на всех этапах ее производства и контроля.<br /><br /><br />Кружки из двухслойного металла долго сохраняют напиток горячим и не обжигают губы<br /><br />Чашка, блюдце, ложка – незаменимые вещи и в офисе, и дома. А эти отличаются еще и тем, что не бьются, так что служить хозяину такая вещь может годами. Большое поле для нанесения: лазерную гравировку можно сделать практически в любом месте в зависимости от вашей фантазии. Выглядит набор стильно и интересно, да и объем кружки идеально подходит для кофе или капучино из кофейного аппарата.<br /><br />Екатерина Ушакова,<br />&quot;ИНПРО&quot;<br />','На две персоны<br />','958','2581','2008-08-27 14:15:35'),
