	('3215','3752','3','Настенное зеркало с часами и датчиком звука',NULL,'пластик, стекло','21,9x21,9x2,5',NULL,NULL,NULL,NULL,'Думаете, только в фантастических фильмах можно управлять предметами домашнего интерьера без помощи рук, просто отдавая им команды голосом? Теперь фантастика становится реальностью. Загляните в это зеркало. С виду в нем нет ничего особенного, но стоит хлопнуть в ладоши – и, как по мановению волшебной палочки, на зеркальной поверхности появятся сменяющие друг друга часы и дата. Их включит встроенный датчик звука. По истечении 40 секунд зеркало снова станет обычным предметом интерьера','LED-часы, календарь и датчик звука','698','22223','2008-08-27 14:15:43'),
