	('3546','853','3','Радио FM',NULL,'пластик, металл','12,5х8,7х2',NULL,NULL,NULL,NULL,'Стильно – это когда нет ничего лишнего. Данный FM-радиоприемник\r\nподходит под определение как нельзя лучше: эргономичный силуэт, минимум\r\nвыступающих деталей, лаконичное световое панно, отображающее время и\r\nрадиодиапазон, телескопическая антенна. <br />\r\n<br />Зато как велико поле для нанесения изображений или надписей!\r\nВ вашем распоряжении вся лицевая панель устройства. <br /><br />Радио идеально для\r\nиспользования на разного рода дилерских конференциях и презентационных\r\nмероприятиях. Такому сувениру непременно найдется место на рабочем столе вашего коллеги или делового партнера.','','259','1565','2008-08-27 14:15:47'),
