	('4076','2373','3','Набор отверток «Пистолет»',NULL,'пластик, металл','19x12x7',NULL,NULL,NULL,NULL,'Это не банальная мультифункциональная отвертка с\r\nтруднодоступным пеналом для наконечников – а почти что лучевой меч героя\r\nГалактики. На худой конец, бластер: четыре сменные насадки «прячутся» в самую настоящую обойму, с легким щелчком заправляющуюся в\r\nрукоять, а остальные 6 помещены в «барабан» и вынимаются оттуда одним\r\nповоротным движением. <br /><br />Нужная насадка надежно фиксируется в гнезде, а\r\nобрезиненная поверхность с выемками для пальцев позволяет удобно\r\nрасположить отвертку в руке, не в пример многим аналогичным изделиям.\r\nТрудитесь на здоровье. Пусть работа станет увлекательной игрой!<br />','','273','12411','2008-08-27 14:15:55'),
