	('4151','1931','3','Универсальное зарядное устройство',NULL,'пластик','8,1х5,9х2,1',NULL,NULL,NULL,NULL,'<p> Уникальный подарок для всех пользователей электронных устройств и цифровой техники. Где бы вы ни находились – дома, в офисе, в дороге или даже во время отдыха на природе – вы можете зарядить мобильный телефон (SonyEricsson, Nokia, Siemens, Samsung) или любую портативную технику с питанием от мини-USB-порта (MP3- или CD-плеер, радио, цифровой фотоаппарат, карманный компьютер и т. п.). Источником питания для зарядного устройства служит бытовая сеть, автомобильный прикуриватель или встроенная солнечная батарея<br />\r\n  <br />\r\n</p>','Устройство имеет собственную батарею и солнечные элементы.<br />Зарядка батареи устройства осуществляется:\r\nот солнечной энергии\r\nот бытовой электросети (шнур в комплекте)\r\nот автомобильного прикуривателя (шнур в комплекте)<br /><span style="font-weight: bold;">Спецификация:</span>\r\nСолнечные элементы – 2 шт., размер каждого 5,6х4,8 см\r\nЕмкость собственной батареи – 600 mAh\r\nНапряжение (на выходе устройства) – 5,5 V\r\nКоличество циклов зарядки – не менее 500\r\nВес устройства – 88 г\r\n','1574','8173','2008-08-27 14:15:56'),
	('4152','2710','3','Цифровая фоторамка',NULL,'пластик','17х23,3х2,5',NULL,NULL,NULL,NULL,'','- цифровой фотопросмотровщик, диагональ дисплея 7 дюймов (17,5 см)<br />- воспроизводит музыку, фильмы, слайд-шоу<br />- цифровой календарь и часы-будильник<br />- форматы 4:3 и 16:9 <br />- совместим с цифровыми носителями: CF, SD, MS, MMC, XD Card (в комплект поставки не входят)<br />- поддерживает форматы: JPEG, WMA, MP3, MPEG1, MPEG4 (DIVX, XVID)<br />- в комплекте: пульт дистанционного управления и адаптер для работы от сети 220 V<br />','7031','20314','2008-08-27 14:15:56'),
	('4153','2075','3','Водный скутер',NULL,'пластик','61х39х34',NULL,NULL,NULL,NULL,'Стремление к свободному полету живет в каждом из нас… Водный скутер позволит реализовать заветную мечту! Он предназначен для осуществления полета в иной среде – водной, для подводного плавания с аквалангом или для сноркелинга (плавание с маской и трубкой). Управление скоростью осуществляется двумя ручками. Для управления движением просто поверните скутер в заданном направлении<br />',' Максимальная скорость – 4,8 км/ч. Время работы на полностью заряженном аккумуляторе – около 90 минут. Максимально допустимая глубина погружения – 30 м. Вес в снаряженном состоянии (с аккумулятором) 11 кг. В комплект входят: сумка для переноски, зарядное устройство, аккумулятор (15 V, время зарядки полностью разряженного аккумулятора 4—6 часов, срок жизни более 500 циклов), инструкция по эксплуатации \r\n \r\n&nbsp; \r\n \r\nДля данного артикула было проведено 2 тест-драйва. Ознакомиться с результатами можете здесь и здесь \r\n\r\n<br />','8216','8202','2008-08-27 14:15:56'),
