	('4155','3969','3','Глобус',NULL,'подставка – акрил','20,5х20,5х24,2',NULL,NULL,NULL,NULL,'<p>Коллекция Levitatio была разработана в Америке группой дизайнеров в содружестве с физиками. Такой тандем позволил создать глобус, который беспрерывно вращается вокруг своей оси. Создается ощущение, что глобусы Levitatio пришли к нам из будущего: движение происходит без батареек, электросети и приложения каких-либо внешних усилий. И даже если взять глобус в руки, он… продолжает вращаться! Можно крутить его в руках, пытаясь наклонить «земную ось», но он примет свое первоначальное положение и будет продолжать вращаться неторопливо и плавно. Даже искушенному зрителю такой глобус кажется нереально ловким фокусом и мистификацией. \r\n  <br /> \r\n  <br />Несомненно, глобус Levitatio - это подарок человеку с несгибаемой силой воли, тому, кто постоянно находится в движении и упорно движется к намеченной цели! \r\n  <br /> \r\n</p> \r\n<p>&nbsp; \r\n</p> \r\n<p> \r\n  <br />Уникальная возможность увидеть нашу планету такой, как она выглядит из космоса \r\n</p>','Винникова Елена Николаевна \r\n ООО «ИНПРО», Генеральный представитель «Проекта 111» в Челябинске и Челябинской области&nbsp;/&nbsp;Челябинск \r\n<br /> (23.05.2008&nbsp;08:20) Не знаю, все уже видели вживую эти глобусы или нет, но .... это чудо! очень завораживает, рекомендую всем поторопиться. Первый же клиент, купивший глобус, собрал пол-офиса и пошли бурные обсуждения, какая же идея в основе -почему вращается. Подарок великолепный! \r\n&nbsp; \r\n','14463','23866','2008-08-27 14:15:56'),
