	('4158','2817','3','Шахматы «Война 1812 года»',NULL,'металл, полимер, картон','игровое поле: 30,5х30,5; упаковка: 30,0х31,0х8,0',NULL,NULL,NULL,NULL,'<p> </p> \r\n<p class="MsoNormal">Представляем вам первые наборы, для которых наше Ателье разработало подарочную упаковку! \r\n</p> \r\n<p> \r\n</p> \r\n<p class="MsoNormal"> \r\n  <br /> \r\n  <br />Фигуры стилизованы под офицеров и солдат российской и французскую армий времен Отечественной войны 1812 года. \r\n  <br /> <u1:p></u1:p>Наполеон Бонапарт и Александр I, Кутузов и Багратион, Аустерлиц и Бородино – знакомые со школьной скамьи имена и названия снова наполняются смыслом.\r\n</p>\r\n<p class="MsoNormal">\r\n  <br />\r\n  <br />Теперь этот достойный подарок поставляется в подарочном футляре, который выполнен из жесткого картона толщиной <st1:metricconverter productid="1,75 мм" w:st="on">1,75 мм</st1:metricconverter> с использованием дизайнерской бумаги, лент, фиксирующих крышку, и ложемента, выложенного шелком, который может подниматься, освобождая место в футляре, поэтому его можно использовать как красивый аксессуар для хранения разных вещей.<o:p></o:p> \r\n</p> <span style="-moz-background-clip: -moz-initial; -moz-background-origin: -moz-initial; -moz-background-inline-policy: -moz-initial; background-attachment: scroll;"></span> \r\n<p>&nbsp; \r\n</p> <u1:p></u1:p> \r\n<p>&nbsp; \r\n</p> \r\n<p>&nbsp; \r\n</p> \r\n<p>&nbsp; \r\n</p> <span style="-moz-background-clip: -moz-initial; -moz-background-origin: -moz-initial; -moz-background-inline-policy: -moz-initial; background-attachment: scroll;"></span> \r\n<br /> \r\n<br />','\r\n  <br /> \r\n <span style="-moz-background-clip: -moz-initial; -moz-background-origin: -moz-initial; -moz-background-inline-policy: -moz-initial; background-attachment: scroll;"></span>','6454','20409','2008-08-27 14:15:56'),
