	('4169','3761','3','DRIVEMOCION 5',NULL,'пластик','24x16,3x3,8',NULL,NULL,NULL,NULL,'Внимание! Ввод персонализированных сообщений возможен только в\r\nпроцессе производства изделия на заводе-изготовителе. Минимальный тираж\r\nсоставляет 500 шт.\r\n\r\n <br /><br />Часто ли вы включением аварийных сигналов выражали благодарность\r\nводителю, пропустившему вас вперед в автомобильной пробке? А что если\r\nнужно не поблагодарить, а выразить другие эмоции? Вашими аргументами\r\nстановятся громкие крики и красноречивые жесты? Не нужно тратить\r\nнервные клетки, поручите это DRIVEMOCION. <br />DRIVEMOCION – великолепный прибор, позволяющий показать ваши\r\nчувства водителю идущей позади машины. Несколько встроенных в память\r\nсообщений появляются на светодиодном дисплее, прикрепленном к заднему\r\nстеклу автомобиля. Активируются они нажатием на одну из кнопок\r\nдистанционного пульта, который можно поместить в любое легко доступное\r\nдля водителя место в салоне. <br /><br />Не надо брани, не надо жестов – будьте цивилизованнее, просто нажмите кнопку!','5 сообщений в памяти','2531','22225','2008-08-27 14:15:56'),
