	('4176','2670.10','3','Ветровка женская TEMPO цвета слоновой кости',NULL,'полиэстер','S—L',NULL,NULL,NULL,NULL,'Tempo — ветровка для женщин, которые ведут активный образ жизни и уделяют особое внимание качеству и безукоризненному стилю своего гардероба.\r\n<br />\r\n<br />Ветровка Tempo выполнена из высокотехнологичного материала и обработана водонепроницаемой пропиткой, которая не препятствует доступу воздуха. Внешний слой изделия изготовлен из полиэстера рипстоп, чтобы защитить обладательницу ветровки от любых непогод. Качественное и стильное исполнение, изысканный цвет (слоновая кость), приталенный крой, капюшон, складывающийся в воротник, вентиляционные отверстия, застежка-молния с защитной планкой, эластичный шнур по низу изделия с ограничителями, эластичные манжеты с планками на липучке — бесспорные аргументы в пользу Tempo!&nbsp;','','1765','20273','2008-08-27 14:15:56'),
